import React from 'react';
import ReactDOM from 'react-dom/client';
import Card from './Card';
import './index.css';

const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);

root.render(
  <>
        <div className="cards">
            <div className="card">
                <img src="https://picsum.photos/200/200?grayscale" alt="myPic" className="card__img"></img>
                <div className="card__info">
                    <span className="card__category">A</span>
                    <h3 className="card__title">{Sdata.sname}</h3>
                    <a href={Sdata.link} target="_blank">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </div>
    </>
)
